import React, { useEffect, useState } from 'react';

import  {
    Col,
    Row,
    Image,
    Form
} from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
import { connect } from 'react-redux';
import { getLogs, answerComment} from '../../../redux/actions/myAgentsActions';
import moment from 'moment';
import Slider from '@material-ui/core/Slider';

// import animationData from '../../../assets/json/loading.json';
import { BiSearch,BiShare } from 'react-icons/bi'; 
import { IoIosClose } from 'react-icons/io'; 
import { AiOutlineEllipsis, AiFillClockCircle } from 'react-icons/ai'; 
import { MdPhone, MdEmail } from 'react-icons/md'; 
import { FaBirthdayCake, FaHome } from 'react-icons/fa'; 
import { RiMapPin2Fill } from 'react-icons/ri'; 
// import { IoIosArrowDown } from 'react-icons/io';
import {ReactComponent as Messenger} from '../../../assets/images/home/messenger.svg';
import {ReactComponent as Calendar} from '../../../assets/images/home/calendar.svg';
import {ReactComponent as Check} from '../../../assets/images/home/check.svg';
// import {ReactComponent as LinkIcon} from '../../../assets/images/home/link.svg';

const Preferences = require('../../../assets/images/home/preferences.svg');
const Preferences_active = require('../../../assets/images/home/preferences_active.svg');
const IMODO_PROFILE_ICON = require('../../../assets/images/home/full-bulle-imodo.png');
const LETTER_ICON = require('../../../assets/images/home/3a.png');
const EMO_ICON = require('../../../assets/images/home/emo.png');
const BALISE_ICON = require('../../../assets/images/home/balise.png');


function MyAgentsMessages(props) {

    let {
        agentsSelectedProject,
        agentsCommentsMatched,
        agentsCommentsNotMatched,
        socialMediaPageSelected,
        intentsMatched,
        intentsNotMatched,

        // Functions:
        getLogs,
        answerComment,
    } = props;

    let history = useHistory();
    const [filter,setFilter] = useState('matched');
    const [choosenComment, setChoosenComment] = useState(null);
    const [answerChoosenComment, setAnswerChoosenComment] = useState('');
    const [showFilter,setShowFilter] = useState(false);
    const [SliderValue, setSliderValue] = useState([18, 82]);
    const [filterMatchedValue, setFilterMatchedValue] = useState('');
    const [filterNotMatchedValue, setFilterNotMatchedValue] = useState('');
    const [filtredIntents, setFiltredIntents] = useState([]);
    const [filtredIntentsNotMatched, setFiltredIntentsNotMatched] = useState([]);
    /*
    handleFilterIntentMatched : handleFilterIntentNotMatched} value={filter === "matched" ? filterMatchedValue : filterNotMatchedValue
    */

    const handleSliderChange = (event, newValue) => {
        setSliderValue(newValue);
    };

    const sliderValueText = (value) => {
        return `${value}%`;
    };

    const handleFilterIntentMatched = (e) => {
        setFilterMatchedValue(e.target.value);
        setFilterNotMatchedValue('');
        
        
        if(e.target.value === "all") {
            setFiltredIntents([]);
            setShowFilter(false);
        } else {
            let filtredIntentsFinal = agentsCommentsMatched.filter((matched) => matched.intent.find((intent) => intent.intent === e.target.value));
            setFiltredIntents(filtredIntentsFinal);
            setShowFilter(false);
        }
    };

    const handleFilterIntentNotMatched = (e) => {
        setFilterNotMatchedValue(e.target.value);
        setFilterMatchedValue('');

        if(e.target.value === "all") {
            setFiltredIntentsNotMatched([]);
            setShowFilter(false);
        } else {
            let filtredIntentsFinal = agentsCommentsNotMatched.filter((notMatched) => notMatched.intent.find((intent) => intent.intent === e.target.value));
            setFiltredIntentsNotMatched(filtredIntentsFinal);
            setShowFilter(false);
        }
    };
    
    useEffect(() => {
        if(agentsSelectedProject) {
            getLogs(agentsSelectedProject.post.idPost,socialMediaPageSelected)
            // .then(() => {
            //     setLoading(false);
            // });
        }
    },[]);
    
    useEffect(() => {
        if(!agentsSelectedProject) {
            history.push('my-agents');
        } 
    },[agentsSelectedProject]);

    const renderDate = (date) => {
        let newDate = moment(date).format("DD/MM/YYYY");
        let newTime = moment(date).format("h:mm");
        return `${newDate} ${newTime}`;
    };

    return (
        <Row>
        <Col lg={3}>
            <Row style={{marginTop : '135px'}}>
                <Col lg={12} className="p-0">
                    <p className="my-agents-msgs-title" >Liste des messages réçus</p>
                </Col>

                <Col lg={12}>
                    <Row className="justify-content-center">
                        <Col lg={6} className={filter === "matched" ? "my-agents-msgs-matched-btn" : "my-agents-msgs-not-matched-btn"} onClick={() => { setChoosenComment(null); setFilter('matched'); }}>
                            Matched
                        </Col>
                        <Col lg={6} className={filter === "not-matched" ? "my-agents-msgs-matched-btn" : "my-agents-msgs-not-matched-btn"} onClick={() => {setChoosenComment(null); setFilter('not-matched'); }}>
                            Not Matched
                        </Col>
                    </Row>
                </Col>

                <Col lg={12}>
                    <Row className="mb-3 justify-content-end ">
                        <Col lg={6} className="">
                            <Row className="mt-2">
                                <Col lg={6} className="p-0">
                                    <a  className="pages-filter-box d-flex py-1 px-1 mr-1"  href="" style={{ textDecoration: 'none'}}>
                                        <Calendar className={"my-auto mr-1 ml-2"} color={"#B4B4B4"}  width="15" height="15" />
                                        <p className={"my-auto"} style={{fontSize: '13px'}}>Date</p>
                                        <span className={"m-auto"}>
                                        </span>
                                    </a>
                                </Col>
                                <Col lg={6} className="p-0">
                                    <div className="pages-filter-box d-flex py-1 px-1 ml-1" style={{ cursor: 'pointer', border: showFilter ? '1px solid #E5007D' : '1px solid #D7DAE2'}} onClick={() => setShowFilter(!showFilter)}>
                                        <Image src={showFilter ? Preferences_active : Preferences} className={"my-auto mr-1 ml-2"} style={{width: '15px', height: '15px'}} />
                                        
                                        <p className={"my-auto"} style={{fontSize: '13px', color : showFilter ? '#E5007D' : '#B4B4B4' }} >Filter</p>
                                        <span className={"m-auto"}></span>
                                    </div>

                                    {showFilter 
                                    &&
                                    <div style={{ position: 'absolute', zIndex: "999", width: '350px', background: '#fff' }}>
                                      <Col lg={12}>
                                          
                                          <Row>
                                            <Col lg={12}>
                                                <p>Filter by intent</p>
                                            </Col>
                                            <Col lg={12} className="d-flex">
                                                <Form.Control as="select" defaultValue={''} onChange={filter === "matched" ? handleFilterIntentMatched : handleFilterIntentNotMatched} value={filter === "matched" ? filterMatchedValue : filterNotMatchedValue } >
                                                    <option value="all">Choose Intent</option>
                                                    {filter === "matched"
                                                    ?
                                                    intentsMatched.map((intent) => 
                                                        <option value={intent}>{intent}</option>
                                                    )
                                                    :
                                                    intentsNotMatched.map((intent) => 
                                                        <option value={intent}>{intent}</option>
                                                    )
                                                    }
                                                </Form.Control>
                                            </Col>
                                          </Row>
                                          
                                          <Row>
                                            <Col lg={12}>
                                                <p>Matched score</p>
                                            </Col>

                                            <Col lg={12} className="d-flex">
                                                <Slider
                                                    value={SliderValue}
                                                    onChange={handleSliderChange}
                                                    valueLabelDisplay="auto"
                                                    aria-labelledby="range-slider"
                                                    getAriaValueText={sliderValueText}
                                                />
                                            </Col>

                                            <Col lg={12} className="d-flex flex-row">
                                                <input type="number" style={{width: '40px'}} value={SliderValue[0]} className="mr-auto" />
                                                <input type="number" style={{width: '40px'}} value={SliderValue[1]} className="ml-auto"/>
                                            </Col>

                                          </Row>


                                      </Col>
                                    </div>
                                    }
                                </Col>
                            </Row>
                        </Col>
                    </Row>
                </Col>
            </Row>
        </Col>
        <Col lg={12}>
            <Row>
                {/* BLOC 1 */}
                <Col lg={3} className="p-0">
                    <div className="pt-3 pb-5 Bloc-Scroll"
                    // style={{
                    //     boxShadow: '1px 1px 2px #00000005',
                    //     borderRadius: '4px',
                    // }}
                    >
